GmblngConfsctdItem:
Violation of PD 1602 (Baraha)

HOW: Joint operatives of the Provincial Intelligence Unit and Dumaguete CPS led by the undersigned conducted a monitoring on reported illegal gambling at Purok 3, Brgy. Looc, Dumaguete City, Neg. Or. This resulted to the actual arrest of the aforesaid suspects and recovery of the pieces evidence related to the aforesaid offense listed to wit;

1.	Bet Money amounting to two hundred forty pesos (Php 240.00);
2.	One (1) set of playing cards;

VII.	Remarks: All arrested suspects were temporarily detained at Dumaguete CPS for proper disposition while recovered pieces of evidence were in temporary custody of the seizing officer for proper disposition.

